Beschrijving
In een half afgebouwde villa in een rijke buurt van Los Angeles stuit een bewaker op de lichamen van een jong stel. Ze liggen verstrengeld in een levenloze omhelzing. Rechercheur Moordzaken Milo Sturgis door de wol geverfd is toch geschokt bij de aanblik van de twee doden. Hij ziet het werk van een verknipte moordenaar. Met de hulp van psycholoog Alex Delaware gaat Milo vastberaden achter iedere aanwijzing aan, maar plotseling gaat het onderzoek een heel andere richting uit


